#include <bits/stdc++.h>

using namespace std;

int helper(int i, vector<int>& heights, vector<int>& dp, int &k, int& n){
    if(i == n-1)
        return 0;

    if(dp[i] != INT_MAX)
        return dp[i];

    for(int j=1; i+j<n && j<=k; j++){
        dp[i] = min(dp[i], helper(i+j, heights, dp, k, n) + abs(heights[i] - heights[i + j]));
    }

    return dp[i];
}

int FrogJump(vector<int>& heights, int k){
    int n = heights.size();
    vector<int>dp(n, INT_MAX);

    return helper(0, heights, dp, k, n);
}

